import React, { useState } from "react";
import { Container, Nav, Navbar } from "react-bootstrap";
import { Link } from "react-router-dom";
// import { logout } from "../redux/action/login";
// import { userLogout, notification } from "../redux/action/user";
import { useSelector, useDispatch } from "react-redux";
// import { imageURI } from "../utils";

const Bar = (props) => {
  const [sidebarActive, setSidebarActive] = useState(false);
  const dispatch = useDispatch();
  const { data } = useSelector((state) => state.user);

  return (
    <Navbar className="nav d-none d-sm-block" bg="white" expand="lg">
      <Container fluid="md" className="py-5">
        <Nav.Item className="logo primary">Zwallet</Nav.Item>
        <Nav.Item className="d-none d-md-flex justify-content-between align-items-center">
          <div className="mr-4">image</div>
          <div className="mr-4">Name</div>
        </Nav.Item>
        <div className={`sidenav ${sidebarActive ? "active" : ""}`}>
          <div className="d-flex justify-content-center flex-column top">
            <div className="image mr-4">image</div>
            <div className="info d-flex flex-column mb-5">name</div>
          </div>
          <hr />
          <div className="d-flex flex-column align-items-center justify-content-between bottom">
            <div className="d-flex justify-content-between flex-column align-items-center">
              <div className="px-4 my-5">
                <span className="big primary bold">
                  <Link to={{ pathname: `/dashboard` }}>Dashboard</Link>
                </span>
                <hr className="bg-primary" />
              </div>
              <div className="py-4 my-5">
                <span className="big primary bold">
                  <Link to={{ pathname: `/transfer` }}>Transfer</Link>
                </span>
                <hr className="bg-primary" />
              </div>
              <div className="px-4 my-5">
                <span className="big primary bold">
                  <Link to={{ pathname: `/topup` }}>Top Up</Link>
                </span>
                <hr className="bg-primary" />
              </div>
              <div className="px-4 my-5">
                <span className="big primary bold">
                  <Link to={{ pathname: `/profile` }}>Profile</Link>
                </span>
                <hr className="bg-primary" />
              </div>
            </div>
            <div className="sidenav-logout align-self-center my-5">
              <span className="big primary bold">
                <Link
                //   onClick={() => {
                //     dispatch(logout());
                //     dispatch(userLogout());
                //   }}
                //   to={{ pathname: `/` }}
                >
                  Logout
                </Link>
              </span>
            </div>
          </div>
        </div>
        <div
          onClick={() => setSidebarActive(!sidebarActive)}
          className="hamburger"
        >
          <div className="bg-primary"></div>
          <div className="bg-primary"></div>
          <div className="bg-primary"></div>
        </div>
      </Container>
    </Navbar>
  );
};

export default Bar;
